                break;
              case 7:
                this.nbPlayerGobelin += 1
                this.nbPlayers += 1;
                break;
              case 8:
                this.nbPlayerAngmar += 1
                this.nbPlayers += 1;
                break;
              default:
                break;
            }
          }
        }
      }
    },
    filters: {
      pourcentage: function (valeur, decimales) {
        if (decimales === undefined) {
          decimales = 2;
        }
        if (valeur === 0) {
          return "";
        }
        return Math.round(valeur * Math.pow(10, decimales)) / Math.pow(10, decimales) + ' %';
      }
    }
